import React from "react";
import '../App.scss';
import contact from '../contact.png';


const Contact = () => {
    return (
        <main class='mainsubgrid' data-router-wrapper>



            <img class='about__pic' src={contact} alt='contactpic'/>


        </main>
    )
}

export default Contact;
